import React from "react";
import './App.css';
import Header from "./header";
import AdicionarProduto from "./Addproduto";
import ListaProdutos from "./ListProduto";

function App() {

  //criei uma variavel modelo dos produtos
  const produtos = [
    {
      id:"1",
      "Nome_do_Produto":"T-shirt",
      "Tamanho":"MM",
      "Cor":"Branca"

    },
    {
      id:"2",
      "Nome_do_Produto":"Calça Jeans",
      "Tamanho":"XL",
      "Cor":"Preta"

    }
  ]

  return (
    <div className = "ui container">
      <Header />
      <AdicionarProduto />
      {/* Adicionando minha variavel na lista dos produtos */}
      <ListaProdutos protuos={produtos}/>
    </div>

  );
}

export default App;
